$(document).ready(function(){$("html").hasClass("lt-ie9")||document.addEventListener("touchstart",function(){},!0);var e=$("#page");$("#utility-nav").on("click","a",function(t){t.preventDefault();var n=$(this).data("panel");if(n=="main-nav"){e.removeClass("is-showing-settings");e.addClass("is-showing-main-nav")}else if(n==="settings"){e.removeClass("is-showing-main-nav");e.addClass("is-showing-settings")}});$("#main-nav").on("click",".btn-close",function(){e.removeClass("is-showing-main-nav")});$("#settings").on("click",".btn-close",function(){e.removeClass("is-showing-settings")})});